import React from 'react';
import { FlatList } from 'react-native';
import EstimationCard from './EstimationCard';

export default function EstimationList() {
    const estimations = {
        content: [
            { name: 'Devis_13215494_gomez.pdf', id: 1 },
            { name: 'Devis_13215495_gomez.pdf', id: 2 },
            { name: 'Devis_13215496_gomez.pdf', id: 3 },
            { name: 'Devis_13215497_gomez.pdf', id: 4 },
            { name: 'Devis_13215498_gomez.pdf', id: 5 }
        ]
    }

    return (
     
        <FlatList
        data={estimations.content}
        renderItem={(item) => <EstimationCard estimation={item}/>}
        keyExtractor={(item, index) => item.id}
      />

    );
}
